import { OxdCheckboxInput, OxdClassicTable, OxdDialog } from '@ohrm/oxd';
export default {
  name: 'DatabaseConfigDialog',
  components: {
    'oxd-dialog': OxdDialog,
    'oxd-check-box': OxdCheckboxInput,
    'oxd-classic-table': OxdClassicTable
  },
  props: {
    productVersion: {
      type: String,
      required: true
    }
  },
  emits: ['closeModel'],
  data() {
    return {
      checked: false,
      headers: [{
        title: 'Add-ons',
        name: 'addon'
      }, {
        title: 'Other',
        name: 'other'
      }],
      items: [{
        addon: '- Toggl (Discontinued)',
        other: '- Marketplace (Discontinued)'
      }]
    };
  },
  computed: {
    optionLabel() {
      return 'I want to continue upgrading the OrangeHRM system to version ' + this.productVersion + ' and I am aware that by doing so, any gathered data in incomplete features/add-ons will be inaccessible.';
    }
  },
  methods: {
    submitInfo() {
      this.$emit('closeModel', this.checked);
    },
    cancelInstallation() {
      this.$emit('closeModel', false);
    }
  }
};
